pragma solidity ^0.8;

contract testDel{
    uint[] public arr = [1,2,3];


    function remove(uint _index)public {
       require(_index<arr.length-1);
       uint len = arr.length;
        arr[_index] = arr[len-1];
        arr.pop();
    }

    function test()external{
        remove(1);
        assert(arr.length ==2);
        assert(arr[1]==3);
    }

}

